INSERT INTO `articles` (`articleid`,`type`,`title`,`content`,`status`,`createtime`,`createuserid`,`createuser`,`toshouye`,`listorder`) VALUES 
 (3,2,'关于在线培训未获得积分的重要说明  ','<font color=\"#800000\"><strong><span style=\"font-size: small\"><span><span><span><font color=\"#0000ff\">观看视频时，每隔10-20分钟会随机跳出&ldquo;已获得XX时间&rdquo;的对话框，应及时点击确认，</font></span></span></span></span><font color=\"#0000ff\"><font size=\"3\">如10分钟内没有点击确认按钮，系统会判断您超时退出，放弃本次确认机会，不能获取刚才时段的时间</font></font></strong><font color=\"#0000ff\"><font size=\"3\">。</font></font>\r\n<div class=\"ExternalClass085011481ED84567BA79621F9B84242F\"><strong><font color=\"#0000ff\" size=\"3\">　　出现超时退出时应重新登录，打开视频窗口后点击&ldquo;继续培训&rdquo;，从上个时段的视频重新听。</font><font color=\"#0000ff\" size=\"3\">切忌超时退出后未重新登录就继续听讲，否则确认框不会再出现，后面的课程也无法计时。</font></strong></div>\r\n<div class=\"ExternalClass085011481ED84567BA79621F9B84242F\"><strong>&nbsp;</strong></div>\r\n<div class=\"ExternalClass085011481ED84567BA79621F9B84242F\"><font color=\"#0000ff\" size=\"3\"><strong>问：如何判断自己已经超时退出？</strong></font></div>\r\n<div class=\"ExternalClass085011481ED84567BA79621F9B84242F\"><font color=\"#0000ff\" size=\"3\"><strong>答：如何您长时间离开座位，没有在确认框出现后10分钟内点击，则很有可能已经超时退出，判断的依据是您点击培训系统中的&ldquo;首页&rdquo;链接，如果显示登录框让您重新登录，则表示您已经超时退出。</strong></font></div>\r\n</font>',1,'2008-05-09 13:31:23',1,'系统管理员',NULL,4),
 (9,2,'为什么课程听完了，却不能得满分？','<div>\r\n<div>在线培训得分规则是由市律协根据不同情况进行设定的，有可能是100%，也有可能是50%、60%，例：如果设定积分比例是80%，那么就是按现场得分的80%计算，比如现场4分的课程，在线视频培训得分为4*80%=3.2分，现场2分的课程，在线视频培训得分为2*80%=1.6分。</div>\r\n<div>&nbsp;</div>\r\n<div>由此可见，网上听课得到了X%的分数就是满分了。</div>\r\n</div>',1,'2008-05-29 11:20:45',3,'管理员',NULL,1);
INSERT INTO `articles` (`articleid`,`type`,`title`,`content`,`status`,`createtime`,`createuserid`,`createuser`,`toshouye`,`listorder`) VALUES 
 (10,2,'为什么年检前这段时间经常打不开视频？','<div>因为临近年检，上线的人特别多，导致服务器带宽受阻，超过了视频服务器的最大连接数，所以出现了能够登录培训系统，但却打不开视频（点击播放按钮时图像一闪而过却无画面显示）的现象，您可以稍后或换个时段再试便可。</div>',1,'2008-05-29 11:26:09',3,'管理员',NULL,2),
 (12,1,' 关于添加律师资料时到东莞执业时间的问题','<p><span style=\"font-size: small\"><br />\r\n</span></p>\r\n<h3 style=\"color: red\"><span style=\"font-size: small\">各律师事务所管理员：<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 添加律师资料时，到东莞的执业时间精确到月份就可以，不影响律师<br />\r\n<br />\r\n的积分统</span><span style=\"font-size: small\">计问题。请各管理员尽快于7月11日前将律师资料完善。谢谢！</span></h3>',1,'2008-07-10 09:06:46',3,'管理员','',0),
 (13,1,'7月18日自由港沙龙地点变更','<h3 style=\"color: red\"><span style=\"font-size: small\"><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 因市司法局一楼电教室设备出现故障，正在维修中，无法使用，<br />\r\n<br />\r\n故7月18日的自由港沙龙活动地点改为市司法局六楼大会议室。</span></h3>',1,'2008-07-16 11:23:59',3,'管理员','',0);
INSERT INTO `articles` (`articleid`,`type`,`title`,`content`,`status`,`createtime`,`createuserid`,`createuser`,`toshouye`,`listorder`) VALUES 
 (14,1,'新形势下劳动争议与法律适用研讨会','<h3 style=\"color: red\"><font color=\"#003399\"><br />\r\n<br />\r\n</font><span style=\"font-size: small\"><font color=\"#003399\">&nbsp;&nbsp;&nbsp; </font><span style=\"color: #ff0000\">&ldquo;</span><span style=\"color: #ff0000\"><span>新形势下劳动争议与法律适用研讨会&rdquo;7月26日（星期六）上午<br />\r\n<br />\r\n9：00－11：30在市司法局六楼会议室举办，8：30－9：00为报到时间。</span></span></span></h3>\r\n<h3 style=\"color: red\"><strong><span style=\"font-size: small\">电子培训卡已下发，请各位律师参加研讨会时带上培训卡，报到时刷卡。</span></strong></h3>\r\n<strong><span style=\"font-size: small\">各位律师如发现培训卡上执业证号有错误的，请联系本单位管理员修改<br />\r\n<br />\r\n培训系统上的执业证号。培训卡执业证号错误不影响卡的使用！</span></strong><br />',1,'2008-07-22 17:09:36',3,'管理员','',0),
 (15,1,'《东莞市律师继续教育培训与考核制度》已经出台','<h3 style=\"color: red\"><span style=\"color: #ff0000\"><span style=\"font-size: small\"><br />\r\n&nbsp;&nbsp;&nbsp;</span><span style=\"color: #ff0000\"><span style=\"font-size: small\"> </span><span style=\"font-size: x-small\">《</span></span><span style=\"font-size: x-small\"><a target=\"_blank\" href=\"http://www.dglawyer.cn/ViewNews.php?id=6179\"><span style=\"color: #ff0000\">东莞市律师继续教育培训与考核制度</span></a></span></span><span style=\"color: #ff0000\"><span style=\"\"><span style=\"font-size: x-small\">》已经出台，<br />\r\n<br />\r\n请各位律师登陆市律协网站&ldquo;行业规章&rdquo;栏或&ldquo;通知公告&rdquo;栏查看具体规定．<br />\r\n<br />\r\n　　　　　　　　　　　　　　二００八年八月三日</span></span></span><span style=\"color: #000000\"><br />\r\n<span style=\"font-size: x-small\"><strong><br />\r\n</strong></span></span><span style=\"font-size: x-small\"><strong><span style=\"color: #000000\">&nbsp;&nbsp;&nbsp; </span></strong></span></h3>',1,'2008-07-28 08:36:54',3,'管理员','',0);
INSERT INTO `articles` (`articleid`,`type`,`title`,`content`,`status`,`createtime`,`createuserid`,`createuser`,`toshouye`,`listorder`) VALUES 
 (16,1,'关于律师市内转所的问题','<p><big><small><span style=\"font-size: small\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"color: #ff0000\"><span style=\"font-size: small\"> </span><strong><span style=\"font-size: x-small\">最近发现一个很严重的问题，就是律师在市内转所的时候，原律师事务<br />\r\n<br />\r\n所将律师在培训系统的资料删除，这导致了一个很严重的后果，就是此转所律<br />\r\n<br />\r\n师的培训积分全部清零。之前在给各律师所管理员进行培训的时候已经告诫过，<br />\r\n<br />\r\n律师在市内转所的时候，其培训系统上的资料律师所不要去动它，市律协管理<br />\r\n<br />\r\n员这边会帮他变换律师所</span></strong></span></small><span style=\"font-family: Arial\"><span style=\"font-size: x-small\"><strong>（各律师所可以这样理解，律师的资料添加进系统以后，<br />\r\n<br />\r\n这些资料的归属权已经属于市律师协会，律师所除了有修改权外没有别的权力，<br />\r\n<br />\r\n请不要越权行事）</strong></span></span><small><span style=\"color: #ff0000\"><strong><span style=\"font-size: x-small\">。望各律师所管理员谨记，如果以后再发生这样的错误，因此给<br />\r\n<br />\r\n转所律师带来的损失后果自负。<br />\r\n<br />\r\n</span></strong></span></small></big></p>\r\n<p><span style=\"color: #ff0000\"><strong><big><small><span style=\"font-size: x-small\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2008年9月24日</span></small></big></strong></span></p>',1,'2008-09-24 10:45:51',3,'管理员','\0',0),
 (17,1,'请各律师所添加新律师资料','<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"color: #ff0000\">各律师事务所有新增律师的(从外地转入或刚执业的),请尽快将新增律师的信息添加进培训系统,以方便市律协统一为他们办理培训卡(另在11月28和11月29这两日有些新增律师参加了培训并已签到,但因律师事务所没有将他们的资料添加入培训系统,导致市律协要给他们添加积分都无法添加).请各律师事务所抓紧时间. </span>',1,'2008-12-02 08:47:46',3,'管理员','',0);
