INSERT INTO `lessonreply` (`replyid`,`lessonid`,`replyuser`,`replycontent`,`replytime`) VALUES 
 (1,15,'19102008101443','骆律师不是说可以把这次文本课件放在网上吗？什么时候才有？我们律所想下载下来，再学习一下（因为当天有同事工作没能参加）','2008-07-09 14:26:36'),
 (2,15,'19100711011851','骆律师的课件是否可以传给大家学习共享。','2008-07-09 19:54:31'),
 (3,15,'19100711015649','没有看到课件啊','2008-07-17 18:51:20'),
 (4,24,'19109711011158','','2008-07-21 13:18:21'),
 (5,15,'19100711015649','建议提供下载功能<br />\r\n<br />','2008-07-26 17:41:05'),
 (6,23,'19100711011851','\r\n		','2008-07-27 15:41:25'),
 (7,22,'191094100081','\r\n		','2008-07-29 15:50:39'),
 (8,24,'19100821016412','我很赞同王玉梅律师加强全所律师专业学习的做法，但东莞不是北京，没法效仿她的方式。我认同黎波律师的团队意识和黄建水律师将当事人作朋友，认认真真为当事人服务的观点。我认为律师进入法院审判区，应当和普通当事人不同待遇，特别是在中级法院更应当如此。这不是律师个人的脸面问题，是维护法律尊严的一个具体体现。律师是法律人，律师法赋予律师多项权利，律师和法官在不同的岗位上为社会主义法制建设服务，所以与案件的当事人及非律师代理人就应当不同。这种不同执法机关应当首先认可、尊重，应当首先体现在程序上。在进门登记的问题上我们律师提出能否凭律师证出入，不需登记是正确的，应当据理力争。','2008-07-31 15:44:01'),
 (9,24,'19100711014807','<p>同意以上观点．</p>','2008-08-01 13:28:04');
