 (20,'第五期自由港沙龙：新型著作权的理解与应用',2,'马立云',1,4,'2008-07-18 15:00','2008-07-18 17:00','市司法局六楼大会议室','<br />\r\n<div style=\"line-height: 30pt\"><span style=\"font-size: 12pt\">各律师事务所（分所）、市法律援助处：</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\"><span style=\"font-size: 12pt\">市律协律师文化建设委员会继6月6日举办了一期以&ldquo;商业秘密侵权案件的诉讼策略&rdquo;为主题的自由港沙龙后，拟再次举办&ldquo;知识产权热点实务&rdquo;系列主题的自由港沙龙活动。现将有关事项通知如下：</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">一、主题：新型著作权的理解与应用</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">二、主讲人：马立云（广东浩宇精英律师事务所主任）</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">三、时间安排：</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">报到时间：7月18日（星期五）下午2：30－3：00</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">主讲时间：3：00－5：00</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">四、地点：市司法局六楼大会议室<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 12pt\">欢迎对知识产权有兴趣的律师和法律爱好者参加此次自由港沙龙活动（各单位无须将参加人员名单报市律协秘书处，拟参加人员届时自行前往活动举办地点参加即可。因培训卡还未制作下发，各执业律师参加时签到即可）。</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">联 系 人：蒲维士（市律协秘书处业务部）</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">联系电话：22459905</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">传<span>&nbsp;&nbsp;&nbsp; </span>真：22508201</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">E-MAIL</span><span style=\"font-size: 12pt\">：weishi_pu@dglawyer-gd.org.cn</span></div>\r\n<div style=\"text-indent: 174pt; line-height: 30pt\" align=\"left\"><span style=\"font-size: 12pt\">东莞市律师协会<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;二○○八年七月十五日<br />\r\n</span></div>',0,'\0',NULL,NULL,'mms://videos.lawyeredu.com/guangdong/dongguan/dg_20080718.wmv','100',3,'2008-07-15 11:38:42',NULL,NULL,NULL,'',NULL,1,'test;','server',20,'N','all');
