 (21,'新形势下劳动争议与法律适用研讨会',2,'彭书红法官',1,4,'2008-07-26 09:00','2008-07-26 11:30','市司法局六楼大会议室','<br />\r\n<div style=\"line-height: 26pt\"><span style=\"font-size: 12pt\">各律师事务所（分所）、市法律援助处：</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 26pt\"><span style=\"font-size: 12pt\">为了更好地理解和适用有关劳动争议法律法规，应广大律师的要求，市律协拟于7月26日（星期六）上午举办&ldquo;新形势下劳动争议与法律适用研讨会&rdquo;，特邀请市法官协会资深法官担任主讲嘉宾。现将有关事项通知如下：</span></div>\r\n<div style=\"text-indent: 18pt; line-height: 26pt\"><span style=\"font-size: 12pt\">一、主讲嘉宾：彭书红法官（市中院民一庭副庭长）</span></div>\r\n<div style=\"text-indent: 18pt; line-height: 26pt\"><span style=\"font-size: 12pt\">二、时间安排：</span></div>\r\n<div style=\"text-indent: 18pt; line-height: 26pt\"><span style=\"font-size: 12pt\">报到时间：7月26日（星期六）上午8：30－9：00</span></div>\r\n<div style=\"text-indent: 18pt; line-height: 26pt\"><span style=\"font-size: 12pt\">研讨会时间：9：00－11：30</span></div>\r\n<div style=\"text-indent: 18pt; line-height: 26pt\"><span style=\"font-size: 12pt\">三、地点：市司法局六楼大会议室（暂定，如有变更会另行通知）</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 26pt\" align=\"left\"><span style=\"font-size: 12pt\">欢迎广大律师和法律爱好者参加此次研讨会。各单位请于7月24日前将参会人员名单报市律协秘书处。（因培训卡还未制作下发，各执业律师参会时凭执业证签到即可，积分会由市律协秘书处于培训系统上添加）。</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 26pt\" align=\"left\"><span style=\"font-size: 12pt\">联 系 人：蒲维士（市律协秘书处业务部）</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 26pt\" align=\"left\"><span style=\"font-size: 12pt\">联系电话：22459905</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 26pt\" align=\"left\"><span style=\"font-size: 12pt\">传<span>&nbsp;&nbsp;&nbsp; </span>真：22508201</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 26pt\" align=\"left\"><span style=\"font-size: 12pt\">E-MAIL</span><span style=\"font-size: 12pt\">：weishi_pu@dglawyer-gd.org.cn</span></div>\r\n<div style=\"text-indent: 174pt; line-height: 26pt\" align=\"left\">&nbsp;</div>\r\n<div style=\"text-indent: 252pt; line-height: 26pt\" align=\"left\"><span style=\"font-size: 12pt\">二○○八年七月十七日</span></div>',0,'\0',NULL,NULL,'mms://videos.lawyeredu.com/guangdong/dongguan/dg_20080726.wmv','75',3,'2008-07-18 11:53:17',NULL,NULL,NULL,'',NULL,1,'0','test',21,'N','all'),
