 (26,'东莞市律师协会成立十周年庆典',1,'庆典',3,5,'2008-11-28 09:00','2008-11-28 11:30','东莞市会议大厦主会场','<br />\r\n<div style=\"line-height: 24pt\"><span style=\"font-size: 12pt\">各律师事务所（分所）、市法律援助处：</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">秋高气爽，金桂飘香，</span><span style=\"font-size: 12pt\">东莞市律师协会</span><span style=\"font-size: 12pt\">迎来建会10周年。</span><span style=\"font-size: 12pt\">为全面回顾和总结东莞律协十年及东莞律师恢复重建以来的发展历程，展示东莞律师的光荣与梦想，弘扬东莞律师的执业精神，经过长时间的筹备，拟定于本月底隆重举行协会十周年庆典，届时将举办庆典大会及第三届东莞律师论坛。现将有关事项通知如下：</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">一、<b>庆典大会</b></span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（一）<span style=\"letter-spacing: -0.5pt\">大会报到时间：2008年11月28日上午8：00-8：45</span></span></div>\r\n<div style=\"margin: 0cm 0cm 0pt 31.8pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（二）大会时间：2008年11月28日上午9：00-11：30（三）<span style=\"letter-spacing: -1.1pt\">大会地点：</span>东莞市会议大厦主会场</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（四）参会人员：全市执业律师</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">二、<b>第三届律师论坛</b></span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（一）<span style=\"letter-spacing: -0.6pt\">论坛报到时间：2008年11月29日上午8：00-8：50</span></span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（二）论坛时间：2008年11月29日上午9：00-12：00</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（三）论坛地点：东莞市会议大厦报告厅</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（四）参会人员：全市执业律师、实习人员</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">三、<b>注意事项</b></span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（一）十年庆典，是全行业的大事、盛事，各律师事务所要高度重视，认真组织和落实本所律师参与，尽量避免其他活动与庆典时间有冲突，确保庆典顺利进行。</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（二）庆典大会全市执业律师都要参加。执业律师确有重要事情不能参加庆典大会的，应于11月26日前向市律协秘书处书面请假，律师事务所负责人不能参加的，书面向秘书长请假。律师事务所如有律师缺席，须另安排实习人员或辅助人员凭票出席，一人一票。如该所座位有空缺，会后将予以通报批评。</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（三）大会期间，请严格遵守会场纪律，手机关机或调为震动，保持会场安静。杜绝迟到早退的现象。</span></div>\r\n<div style=\"text-indent: 32.05pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（四）请参加人员正装（建议男深色西装、领带；女，套装）出席。会前，请到签到席签到，领取会议材料及纪念品，凭入场券入场就座。会后，请律师到签到席刷培训卡以确认课时（庆典大会和论坛各计5个课时）。领取入场券时间另行通知。</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（五）此前，参加庆典大会宣誓仪式的律师要求统一着装，一律穿着律师袍、白色衬衣，佩戴领带、大徽章。报到时需要本人签名确认，以确保宣誓仪式顺利进行。</span></div>\r\n<div style=\"text-indent: 24pt; line-height: 24pt\"><span style=\"font-size: 12pt\">（六）由于活动参与人员众多，停车位有限，建议各单位安排律师集中坐车前往会场。</span></div>',0,'\0',NULL,NULL,'mms://videos.lawyeredu.com/guangdong/dongguan/dg_20071012.wma','100',3,'2008-11-20 16:49:46',NULL,NULL,NULL,'',NULL,1,'server;','test',26,'N','online'),
 (27,'第三届东莞律师论坛',1,'徐昕、鲁罡、张敬智',1,5,'2008-11-29 09:00','2008-11-29 12:00','东莞市会议大厦报告厅','<p><br />\r\n&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; line-height: 30pt; mso-line-height-rule: exactly\"><span style=\"font-size: 12pt; font-family: 宋体\">各律师事务所（分所）、市法律援助处：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; font-family: 宋体\">东莞市律师协会成立十周年庆典活动于<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">28-29</span>日隆重举行。在<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">28</span>日举行庆典大会后，市律协于<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">29</span>日上午在市会议大厦报告厅隆重举行第三届东莞律师论坛。现将有关事项通知如下：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; font-family: 宋体\">一、论坛报到时间<span style=\"letter-spacing: -1pt\">：<span lang=\"EN-US\">2008</span>年<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">29</span>日上午<span lang=\"EN-US\">8</span>：<span lang=\"EN-US\">00-8</span>：<span lang=\"EN-US\">50<o:p></o:p></span></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; font-family: 宋体\">二、论坛时间：<span lang=\"EN-US\">2008</span>年<span lang=\"EN-US\">11</span>月<span lang=\"EN-US\">29</span>日上午<span lang=\"EN-US\">9</span>：<span lang=\"EN-US\">00-12</span>：<span lang=\"EN-US\">00<o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; font-family: 宋体\">三、论坛地点：东莞市会议大厦二楼报告厅<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; font-family: 宋体\">四、论坛主题：经济社会发展转型与律师执业展望<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt 28.45pt; line-height: 30pt; mso-line-height-rule: exactly; mso-para-margin-left: 2.71gd\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: 宋体\"><span style=\"mso-spacerun: yes\">&nbsp; </span><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;</span><span style=\"mso-spacerun: yes\">&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size: 12pt; font-family: 宋体\">&mdash;&mdash;暨纪念东莞市律师协会成立十周年律师论坛<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt 28.45pt; line-height: 30pt; mso-line-height-rule: exactly; mso-para-margin-left: 2.71gd\"><span style=\"font-size: 12pt; font-family: 宋体\">五、论坛形式：嘉宾主题发言与现场互动相结合的形式<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 18pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 1.5\"><span style=\"font-size: 12pt; font-family: 宋体\">六、论坛主持人：叶乃锋，市律协业务发展与职业培训委员会主任，法学博士，广东达维律师事务所负责人<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; font-family: 宋体\">七、主讲嘉宾：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; text-align: left; mso-line-height-rule: exactly; mso-pagination: widow-orphan; mso-char-indent-count: 2.0; mso-layout-grid-align: none\" align=\"left\"><span style=\"font-size: 12pt; font-family: 宋体\">（一）徐昕，</span><span style=\"font-size: 12pt; layout-grid-mode: line; color: black; font-family: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">西南政法大学教授，博士生导师，司法研究中心主任<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 23.5pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 1.96\"><v:line id=\"_x0000_s1026\" style=\"z-index: 1; left: 0px; position: absolute; text-align: left\" strokeweight=\"3pt\" strokecolor=\"red\" to=\"6in,39pt\" from=\"-18pt,39pt\"></v:line><span style=\"font-size: 12pt; font-family: 宋体\">（二）鲁罡，东莞市人民检察院副检察长<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; color: black; font-family: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">（三）张敬智，广东历维永盛律师事务所负责人<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 24pt; line-height: 30pt; mso-line-height-rule: exactly; mso-char-indent-count: 2.0\"><span style=\"font-size: 12pt; color: black; font-family: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">八、注意事项：<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 32.05pt; line-height: 30pt; mso-line-height-rule: exactly; tab-stops: 36.0pt\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: 宋体\">1.</span><span style=\"font-size: 12pt; font-family: 宋体\">请各单位积极发动律师、律师助理依时参加。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; text-indent: 32.05pt; line-height: 30pt; mso-line-height-rule: exactly\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: 宋体\">2.</span><span style=\"font-size: 12pt; font-family: 宋体\">律师在报到时刷培训卡以确认培训课时（论坛计<span lang=\"EN-US\">5</span>个课时）。座位有限，先到先坐。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p>&nbsp;</p>',0,'\0',NULL,N