 (38,'《反垄断法》大型讲座',NULL,'尚明 ',1,4,'2009-03-01 14:00',NULL,NULL,'<div>\n<div style=\"text-indent: 30pt; line-height: 150%\" align=\"center\"><span style=\"font-size: 15pt; line-height: 150%\">《反垄断法》大型讲座</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"center\">&nbsp;</div>\n<div style=\"text-indent: 20pt; line-height: 150%\"><span style=\"font-size: 10pt; line-height: 150%\">为了提高深圳律师对最近通过的反垄断法的认识，及时掌握最新的法律动态，宣传反垄断法，经市律协反垄断反不正当竞争法律业务委员会联系，市律协邀请国家商务部条法司司长、反垄断调查办公室主任尚明到我市就反垄断的有关内容进行讲解，具体通知事项如下：</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">一、讲座时间：</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">2007</span><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">年9月14日</span><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">（星期五）下午14：00-16：30。</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">二、讲座地点：</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">金盾剧院（深南中路岗厦汽车站）。</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">三、主讲人：</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">尚明<span>&nbsp;&nbsp; </span></span><span style=\"font-size: 10pt; line-height: 150%\">国家商务部条法司司长、反垄断调查办公室主任</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">四、讲座主题：</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">反垄断法</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">五、讲座内容：</span></div>\n<div style=\"text-indent: 25pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; line-height: 150%\">反垄断法三大支柱的执法，主要讲解经营者集中规制部分。</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">六、参加人员：</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">全市注册律师(含公职律师和公司律师)</span></div>\n<div style=\"text-indent: 20pt; line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">请各律师事务所认真组织有兴趣的律师准时参加讲座，并携带电子培训卡以备刷卡，讲座开始后半小时停止刷卡，禁止代刷。本次讲座计4个学分。</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">&nbsp;&nbsp;&nbsp; </span><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">由于金盾剧院停车位有限，请各位律师乘坐出租车或公交车前往。</span></div>\n<div style=\"line-height: 150%\" align=\"left\">&nbsp;</div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">联系人：黄训&nbsp;屈 楠</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">电&nbsp;话：83025728&nbsp;88281543</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">传&nbsp;真：83025177</span></div>\n<div style=\"line-height: 150%\" align=\"left\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">E-mail: szlx@szlawyers.com</span></div>\n<div style=\"margin: 0cm 16pt 0pt 0cm; text-indent: 165pt; line-height: 150%\" align=\"right\"><span style=\"font-size: 10pt; color: #333333; line-height: 150%\">深圳市律师协会</span></div>\n<div style=\"text-indent: 165pt; line-height: 150%\" align=\"right\"><span style=\"font-size: 10pt; line-height: 150%\">二</span><span style=\"font-size: 10pt; line-height: 150%\">〇〇</span><span style=\"font-size: 10pt; line-height: 150%\">七年九月七日</span></div>\n</div>',NULL,NULL,NULL,NULL,'mms://www.szlawyers.com/guangdong/shenzhen/sz_20070914.wmv','100',0,'2009-03-01 22:22:19',NULL,NULL,NULL,NULL,'反垄断法',5,'dongguan;changchun;nanning;test;','shenzhen',35,'N','online');
