 (131,50,'19100811016801','王华成',NULL,'G',NULL,NULL,'C47CAE2A022635D438303731964D6A60',NULL,0,NULL,'\0',NULL,'15019993116','中共党员,法学本科学历,信用等级AA级,中华全国律协会员。91年开始从事法律工作，92年考取律师资格；94年获得税务师资格。担任人民法院陪审员3年、律师事务所合伙人7年及专职执业律师14年、市委政府律师顾问团成员5年、人事争议仲裁委兼职仲裁员4年等，于2008年4月入广东尚宽律师事务所执业。在《律师世界》、《中国律师》、《当代律师》等发表专业论文及研讨文章20余篇。第二届全国律师博客大赛优秀博客奖获得者。办理各种律师业务2000余件。熟悉各种律师业务，尤擅长办理刑事辩护及代理、交通事故及保险赔偿、公司企业改制及清算、单位及个人法律顾问、资信调查及取证、劳动及人事争议、审查合同及见证等业务。','19102007101339','2008-06-25 16:56:43','19100811016801','420683196812200518','1217381755381.jpg','2008-04-18','0012262765',NULL,1),
