 (757,43,'19100611011748','游成志',NULL,'G',NULL,NULL,'46ECF40DE49153754E5B542CC4678F98',NULL,0,NULL,'\0',NULL,'13669878228','姓名:  游成志、男、35岁、湖北咸宁人                    \r\n政治面貌:党 员   学位:法学士   外语水平:  CET四级\r\n毕业学校:中南政法学院  专业:经济法专业    学历:大学本科\r\n职称资格：法律职业资格、中级金融经济师、中级电信营销师、保险代理资格\r\n\r\n工作理念：\r\n正义感  责任心  专业性  人性化\r\n工作经历：\r\n曾担任过建设银行咸宁市分行信贷管理、法务主管、支行副行长，东莞市移动公司营销经理、并在广东天伦律师事务所、广东金名律师事务所、广东旗峰律师事务所工作过，现为广东林德律师事务所律师。从业来为和记黄埔、东莞冠亚集团、东莞工商银行、恒新实业公司、厚街海逸豪庭、珠江实业、金胜物业管理、石竹新花园建造有限责任公司、伏龙之高尔伏俱乐部有限公司、东莞市明轩大酒店等一批知名的大中型公司企业提供过法律服务，参与了世新实业收购某国家一级建筑企业的收购及重组工作。\r\n自我评价:\r\n精通法律、金融、通信、建筑行业业务，具备6年大型企业管理工作和8年法律服务经验。善于沟通、调解和商务谈判，具备人员培训、制度制定和实施、活动策划、经营管理等能力，善于企业并购和房地产等非诉讼业务，善于处理各类民商事合同纠纷、劳资、婚姻、继承、交通事故、工伤纠纷，特别是建筑工程纠纷，是一个综合性法律人才。\r\n\r\n联系电话:013669878228或0769—23182666  工作 Q Q:  497695459\r\nE-mail: youchengzhi2003@yahoo.com.cn 或497695459@qq.com   \r\n','19102006101271','2008-07-01 09:41:01','19100611011748','422301197202110019','1215134674305.jpg','2006-05-25','0012317680',NULL,1),
