 (1057,12,'19100311011397','李继华',NULL,'G',NULL,NULL,'FF183F879C6E45ED5C547E940A21B1A9',NULL,0,NULL,'\0',NULL,'13826938225','李继华律师，法律硕士研究生，从事法官、律师20余年，是20余家政府，权威企业的法律顾问团首席律师。亲自或带领律师团办结过经济、劳动工伤、交通事故、离婚、刑事辩护等1000余宗各类案件。经验丰富，人缘关系良好。曾经协助两家顾问单位成功上市；成功调解多起群体事件，为政府、企业解难排忧；经过李律师艰辛辩护，使十余名死刑犯被改成死缓，无期徒刑或从轻、减轻刑事处罚。为当事人挽回经济损失一亿八千万元，深受顾客好评，多次被司法行政部门评为“先进个人”“优秀法律工作者”“优秀普法者”。擅长专业：法律顾问、刑事辩护、交通事故、劳动工伤、伤害索赔、婚姻财产 。郑重承诺：受君之托，忠君之事！  最大心愿：和谐社会，法制中国。','191096100596','2008-07-09 15:14:00','19100311011397','432824196701150030','1215587640895.jpg','2003-06-27','0012303937',NULL,1),
