DROP TABLE IF EXISTS `sys_right`;
CREATE TABLE `sys_right` (
  `RIGHTCODE` varchar(20) NOT NULL,
  `RIGHTNAME` varchar(20) NOT NULL COMMENT '功能名称',
  `PARENTCODE` varchar(20) DEFAULT NULL COMMENT '模块代码，所在的功能或者模块',
  `LOGFLAG` bit(1) NOT NULL DEFAULT '' COMMENT '是否记录日志1记录0不记录',
  `ISMENU` bit(1) NOT NULL DEFAULT '\0' COMMENT '是否菜单链接对应的功能',
  `ISCOMMON` bit(1) DEFAULT '\0' COMMENT '是否公用功能,默认为false',
  `ISNODE` bit(1) NOT NULL DEFAULT '' COMMENT '是否最底层的一个功能节点',
  `GRADE` tinyint(4) DEFAULT NULL COMMENT '级别,实际上相当于将菜单部分也囊括了进来，到时一一对应好就ok',
  `ORDERID` tinyint(4) NOT NULL DEFAULT '1' COMMENT '显示顺序,对menulevel和parentid都相同的起作用',
  `IMAGEURL` varchar(100) DEFAULT NULL COMMENT '对应的图标',
  `LINKURL` varchar(100) DEFAULT NULL COMMENT '链接地址',
  `COMMENTS` varchar(200) DEFAULT NULL COMMENT '描述内容',
  `OPENTARGET` varchar(20) DEFAULT NULL COMMENT '在哪个frame中打开',
  PRIMARY KEY (`RIGHTCODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

