  `GVISIBILITY` text COMMENT '可看到的部门数据 如果为-1，能看当前部门所有的 为0，不考虑部门可见性，所有人的都可以 为1,2,3的形式,能看到其他部门的',
  `COMMENTS` text COMMENT '角色描述',
  `CREATEUSER` varchar(20) DEFAULT NULL COMMENT '创建人员',
  `CREATETIME` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`ROLEID`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='系统角色表';

